<template>
  <div>
    <div>{{drag?'拖拽中':'拖拽停止'}}</div>
    <div style="display: flex">
      <div style="height: 600px;overflow-y: auto;border: 1px solid;width: 610px">
        <JvDraggable :isFloat="true" group="aa" v-model="defaultList" @start="onStart" @end="onEnd" animation="10" ref="JvDraggableRef">
          <template slot-scope="item">
            <div style="width: 50%;height: 50px; background: #fff;margin-bottom: 10px">{{item}}</div>
          </template>
        </JvDraggable>
      </div>
      <div style="width: 50px"></div>
      <div style="height: 600px;overflow-y: auto;border: 1px solid;min-width: 300px">
        <JvDraggable group="aa" v-model="list" @start="onStart" @end="onEnd" animation="10" ref="JvDraggableRef">
          <template slot-scope="item">
            <div style="width: 300px;height: 50px; background: #fff;margin-bottom: 10px">{{item}}</div>
          </template>
        </JvDraggable>
      </div>
    </div>
    <button @click="download">点我 下载带图片的excel</button>

    <ExcelPreview />

    <el-input v-model="fileUrl"></el-input>

    <button @click="getFileUrl">获取url</button>
  </div>
</template>

<script>
//导入draggable组件
import JvDraggable from '@/components/JvDraggable/JvDraggable.vue';

import ExcelJS from 'exceljs';
import { saveAs } from 'file-saver';

import ExcelPreview from '@/components/ExcelPreview/index.vue'
// http://localhost:61823/files/down_file/api/Files/1821382120233238530.xlsx

export default {
  //注册draggable组件
  components: {
    JvDraggable,
    ExcelPreview
  },
  data() {
    return {
      fileUrl: 'http://192.168.1.66:8015/Files/2024/08/12/1822819364559126529.xls',
      drag: false,
      //定义要被拖拽对象的数组
      defaultList: [
        {people: 'l1', id: 1, name: 'www.itxst.com'},
        {people: 'l2', id: 2, name: 'www.baidu.com'},
        {people: 'l3', id: 3, name: 'www.taobao.com'},
        {people: 'l4', id: 4, name: 'www.google.com'},
        {people: 'l5', id: 5, name: 'www.google.com'},
        {people: 'l6', id: 6, name: 'www.google.com'},
      ],
      list: [
        {people: 'r1', id: 1, name: 'www.itxst.com'},
        {people: 'r2', id: 2, name: 'www.baidu.com'},
        {people: 'r3', id: 3, name: 'www.taobao.com'},
        {people: 'r4', id: 4, name: 'www.google.com'},
        {people: 'r5', id: 5, name: 'www.google.com'}
      ]
    };
  },
  methods: {
    download() {
    // 创建一个新的工作簿
      const workbook = new ExcelJS.Workbook();
      const worksheet = workbook.addWorksheet('Sheet 1');

// 添加图片
      const imageId = workbook.addImage({
        base64: 'data:image/jpeg;base64,', // 替换为你的图片base64编码
        extension: 'png',
      });

// 将图片插入到单元格中，并设置尺寸
      worksheet.addImage(imageId, {
        tl: { col: 0, row: 0 }, // 左上角单元格
        br: { col: 1, row: 1 }, // 右下角单元格
        editAs: 'oneCell', // 使图片适应单元格大小
      });

    // 设置单元格的宽度和高度
      worksheet.getColumn(1).width = 10; // 设置第一列的宽度
      worksheet.getRow(1).height = 50; // 设置第一行的高度

    // 导出Excel文件
      this.exportFile(workbook);
    },
    async exportFile(workbook) {
      const buffer = await workbook.xlsx.writeBuffer();
      const blob = new Blob([buffer], { type: 'application/vnd.openxmlformats-officedocument.spreadsheetml.sheet' });
      saveAs(blob, 'example.xlsx');
    },
    //开始拖拽事件
    onStart() {
      this.drag = true;
    },
    //拖拽结束事件
    onEnd(list) {
      this.drag = false;
    },
    async getFileUrl() {
      var url = await COSDocPreviewSDK.getPreviewUrl( {
        objectUrl: this.fileUrl,
        // credentials: {      // 如果预览文件是私有的，则需要携带访问凭证。
        //   secretId: '',
        //   secretKey: '',
        //   authorization: 'q-sign-algorithmxxxxxxxxxxxxxxx',
        // },
        copyable: 0,  // 是否可以复制文件内容
        htmlwaterword: ''  // 水印内容
      })
      console.log(url)
    }
  },
};
</script>

